import './notfound.scss';
const NotFound = () => {
    return ( 
        <div className="notFound">
            <img src="https://thumbs.dreamstime.com/b/illustration-soccer-player-sad-afro-descendant-knee-front-ball-defeated-eliminated-lose-illustration-soccer-player-175534007.jpg" alt="" className="notFoundImg" />
            <h1 className='titleh1'>Oops!!</h1>
            <h2 className='titleh2'>The Content is not Found</h2>
        </div>
     );
}
 
export default NotFound;
